import React from 'react';
import ReactDOM from 'react-dom/client';

const root = ReactDOM.createRoot(document.getElementById('root'));
const x = 5;
let text = "f";
if(x < 10)
{
  text  = "hello";
}
else
{
  text = "goodbye";
}

const element = <div>
{text}


</div>





root.render(element);
